local height = platform.window:height() --212
local width = platform.window:width() --318

local birdState = 0
local birdHeight = 100
local groundCounter = 0

local pipes = {}
pipes[0] = physics.Vect(width + 12, math.random(44, 128))
local dead = false

function on.paint(gc) --basically the main loop

	--at 30fps
	timer.start(0.033)
		
	--------------------------------------------------------------------------------------

	--update bird state
	birdState = birdState + 1;
	if birdState == 3 then
		birdState = 0
	end
	
	--update ground counter
	groundCounter = groundCounter + 1
	if groundCounter == 5 then
		groundCounter = 0
	end
	
	--update pipe location
	for i = getPipeStartingNum(), table.getn(pipes) do
		pipes[i]:setx(pipes[i]:x() - 4)
	end

	if pipes[table.getn(pipes)]:x() < 256 then
		pipes[table.getn(pipes) + 1] = physics.Vect(width + 12, math.random(44, 128))
	end
	
	dead = false
	
	--if bird collides with pipe
	birdBB = physics.BB(27, birdHeight - 6, 43, birdHeight + 6)
	for i = getPipeStartingNum(), table.getn(pipes) do
		pipeUpBB = physics.BB(pipes[i]:x() - 12, pipes[i]:y() - 191.5, pipes[i]:x() + 12, pipes[i]:y() - 21.5)
		pipeDownBB = physics.BB(pipes[i]:x() - 12, pipes[i]:y() + 21.5, pipes[i]:x() + 12, pipes[i]:x() + 191.5)
		if pipeUpBB:intersects(birdBB) or pipeDownBB:intersects(birdBB) then
			dead = true
		end
	end
	
	--------------------------------------------------------------------------------------
	
	--draw the stuff--
	gc:drawImage(background, 0, 0)
	drawBird(birdState, gc) --bird
	for i = getPipeStartingNum(), table.getn(pipes) do --pipes
		if pipes[i]:x() >= -12 then
			
			drawPipes(pipes[i]:x(), pipes[i]:y(), gc)
		end
	end
	gc:drawImage(ground, -(4 * groundCounter), height - 41) --ground

	--just for testing stuff
	gc:drawString(table.getn(pipes), 100, 100)
	--more testing
	if dead then
		gc:drawString("dead", 115, 100)
	end
	
end

function drawBird(state, gc)
	local tex
	if state == 0 then
		tex = bird1
	elseif state == 1 then
		tex = bird2
	elseif state == 2 then
		tex = bird3
	end
	--draw the bird
	gc:drawImage(tex, 35, birdHeight - 6)
end

function drawPipes(ex, why, gc)
	--draw bottom pipe
	gc:drawImage(pipe, ex - 12, why + 21.5)
	--draw upper pipe
	gc:drawImage(pipeFlip, ex - 12, (why - 21.5) - image.height(pipe))
end

function getPipeStartingNum()
	if table.getn(pipes) < 6 then
		return 0
	else
		return table.getn(pipes) - 6
	end
end

function on.timer()
	platform.window:invalidate()
end
